import React from "react";
import "../css/Navbar.css"
import { Link } from "react-router-dom";
const Navbar = ({user}) => {
  const logoutChange = ()=>{
    window.open('http://localhost:5000/auth/logout','_self')
  }
  return (
    <div className="navbar">
      <span className="logo"><Link to='/' className="logo">Arun App</Link></span>
      {
        user ? (
          <ul className="list">
          <li className="listItem">
              <img src="data:image/png;base64," alt=""  className="avatar"/>
          </li>
          <li className="listItem" >Arun </li>
          <li className="listItem" onClick={logoutChange}>Logout</li>
        </ul>
        ): 
         <Link to='/login' className="logo">Login</Link>
      }

    </div>
  );
};

export default Navbar;
